INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(1, 'Alia Bhatt', , 'Alia Bhatt is an Indian actress who appears in Bollywood films. She is the daughter of director, producer, and screenwriter Mahesh Bhatt and Soni Razdan, a film actress and director. She has one sister Shaheen Bhatt, a half sister Pooja Bhatt, and a half brother Rahul Bhatt. Actor Emraan Hashmi and director Mohit Suri are her cousins and producer Mukesh Bhatt is her uncle. Alia has completed high-school from Jamnabai Narsee School IB in May 2011.', '1993-03-15 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(2, 'Varun Dhawan', , 'Varun Dhawan is an Indian actor working in Bollywood films. The son of film director David Dhawan, he studied Business Management in England, after which he worked as an assistant director to Karan Johar on the 2010 drama My Name Is Khan. Dhawan made his acting debut with Johar\'s 2012 romantic comedy Student of the Year, a box office success, for which he received a Filmfare nomination for Best Male Debut. In 2014, he starred as the protagonist of two commercially successful comedies Main Tera Hero and Humpty Sharma Ki Dulhania.', '1987-04-24 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(3, 'Shah Rukh Khan', , 'Shah Rukh Khan (born November 2, 1965) is a prominent Bollywood actor and producer. He made his film debut in Deewana (1992). In 2005, the Government of India honoured him with the Padma Shri for his contributions towards Indian Cinema.\r\n\r\nIn 2003, he founded the motion picture production company Red Chillies Entertainment together with his wife Gauri Khan.', '1965-02-11 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(4, 'Shahid Kapoor', , 'Kapoor also known as Shahid Khattar, is an Indian actor who appears in Hindi films was born to actor Pankaj Kapoor and actor/classical dancer Neelima Azeem.\r\n\r\nKapoor made his film debut in 2003 with a leading role in the romantic comedy Ishq Vishk, a sleeper hit for which he won a Filmfare Award for Best Male Debut. Kapoor earned nominations for the Filmfare Award for Best Actor for portraying a troubled businessman in Imtiaz Ali\'s romantic comedy Jab We Met (2007) and twin brothers in Vishal Bhardwaj\'s caper thriller Kaminey (2009).\r\n\r\nCited in the media as one of the most attractive Indian celebrities, Kapoor maintains his popularity despite a fluctuating career trajectory. Initially recognised for portraying romantic roles, Kapoor has since taken on parts in action films and thrillers.', '1981-02-25 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(5, 'Amrita Rao', , 'From Wikipedia, the free encyclopedia\r\n\r\nAmrita Rao ( born 17 June 1981) is an Indian actress who appears in Bollywood films.\r\n\r\nBeginning her career as a model, Rao made her acting debut with Ab Ke Baras (2002). She then starred in Ken Ghosh\'s love-story Ishq Vishk (2003) and earned a Filmfare nomination in the \"Best Female Debut\" category.\r\n\r\nDescription above from the Wikipedia article Amrita Rao, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1981-06-07 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(6, 'Ranbir Kapoor', , 'Ranbir Kapoor is an Indian actor who appears in Bollywood movies. He first appeared in the 2007 film Saawariya for which he won a Filmfare Best Male Debut Award.\r\n\r\nBorn to actors Rishi Kapoor and Neetu Singh, Kapoor is the great grandson of Prithviraj Kapoor and the grandson of actor and filmmaker Raj Kapoor. He is the brother of Riddhima Kapoor and his uncles are Randhir Kapoor and Rajiv Kapoor. Other notable family members include his cousins Karisma Kapoor, Kareena Kapoor and Nikhil Nanda. As a child, Kapoor studied at Bombay Scottish School in Mahim, Mumbai, and went on to pursue method acting at The Lee Strasberg Theatre and Film Institute in New York.\r\n\r\nKapoor currently lives with his parents in Pali Hill in Mumbai, Maharashtra. He announced that he was dating Bollywood actress Deepika Padukone in an interview in February 2008. The couple later broke up in October 2009.', '1982-09-28 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(7, 'Deepika Padukone', , 'Deepika Padukone is an Indian film actress. She is one of the highest-paid actresses in the world and is cited in the media as one of the nation\'s most popular and attractive personalities. Padukone has established a career in Hindi films, and is the recipient of several awards, including three Filmfare Awards. Padukone, the daughter of the badminton player Prakash Padukone, was born in Copenhagen and raised in Bangalore. As a teenager she played badminton in national level championships, but left her career in the sport to become a fashion model. She soon received offers for film roles, and made her acting debut in 2006 as the title character of the Kannada film Aishwarya. Padukone then played a dual role in her first Bollywood release the 2007 blockbuster Om Shanti Om and won a Filmfare Award for Best Female Debut. The 2012 box office hit Cocktail marked a turning point in Padukone\'s career, earning her praise and Best Actress nominations at several award ceremonies. She rose to prominence with starring roles in the comedies Yeh Jawaani Hai Deewani (2013), Chennai Express (2013), and Happy New Year (2014), and the historical romance Bajirao Mastani (2015), all of which rank among the highest-grossing Bollywood films. Padukone\'s acclaimed portrayal of a character based on Juliet in the tragic romance Goliyon Ki Raasleela Ram-Leela (2013) and a headstrong architect in the comedy-drama Piku (2015) won her two Best Actress awards at Filmfare. Alongside her acting career, Padukone participates in stage shows, has written columns for an Indian newspaper, is a prominent celebrity endorser for brands and products, and is vocal about issues such as feminism and depression. She has designed her own line of clothing for women and is the founder of The Live Love Laugh Foundation, which creates awareness on mental health in India.', '1986-01-05 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(8, 'Kartik Aaryan', , 'Kartik Tiwari, better known as Kartik Aaryan, is an Indian actor who appears in Hindi films. Born and raised in Gwalior, he relocated to Navi Mumbai to pursue an engineering degree in biotechnology. He simultaneously dabbled in modelling and made attempts to start a career in film.', '1990-11-22 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(9, 'Kriti Sanon', , 'Kriti Sanon is an Indian model and film actress. After a successful modeling career, she made her acting debut with Sukumar\'s Telugu psychological thriller film 1: Nenokkadine, and subsequently made her Bollywood debut in Sabbir Khan\'s commercially successful action-romance film Heropanti. (Wikipedia)', '1990-07-27 00:00:00');

